webpackJsonp([0xc23d8c205896],{3736:function(e,o){e.exports={data:{challengeNode:{title:"Add Key-Value Pairs to JavaScript Objects",description:["对象（object）本质上是<dfn>键值对（key-value pair）</dfn>的集合，或者说，一系列被映射到唯一标识符（叫做<dfn>属性（property）</dfn>或者<dfn>键（key）</dfn>）的数据。让我们来看一个很简单的例子：","<blockquote>let FCC_User = {<br>&nbsp;&nbsp;username: 'awesome_coder',<br>&nbsp;&nbsp;followers: 572,<br>&nbsp;&nbsp;points: 1741,<br>&nbsp;&nbsp;completedProjects: 15<br>};</blockquote>","上面的代码定义了一个叫做<code>FCC_User</code>的对象，它有 4 个<dfn>属性</dfn>，每个属性映射一个特定的值。如果我们想知道<code>FCC_User</code>有多少<code>followers</code>，我们可以这样访问其<code>followers</code>属性：","<blockquote>let userData = FCC_User.followers;<br>// userData 等于 572</blockquote>","这叫做<dfn>点符号（dot notation）</dfn>。我们还可以用方括号符号来访问对象中的属性：","<blockquote>let userData = FCC_User['followers']<br>// userData 等于 572</blockquote>","注意，在用<dfn>方括号符号</dfn>时，我们在括号里写的是字符串<code>followers</code>（用引号括起）。方括号符号让我们能用一个变量作为属性名来访问对象的属性（请记住）。若我们在方括号中不写引号而直接写<code>followers</code>，JavaScript 引擎会将其看作一个变量，并抛出一个<code>ReferenceError: followers is not defined</code>的错误。","<hr>","用这样的语法，我们还可以向对象中<em><strong>新增</strong></em>键值对。我们已经创建了一个有 3 个属性的<code>foods</code>对象，请为其新增 3 项：值为<code>13</code>的<code>bananas</code>属性、值为<code>35</code>的<code>grapes</code>属性和值为<code>27</code>的<code>strawberries</code>属性。"],challengeType:1,fields:{slug:"/javascript-algorithms-and-data-structures/basic-data-structures/add-key-value-pairs-to-javascript-objects",blockName:"Basic Data Structures",tests:[{text:"<code>foods</code>应该是一个对象。",testString:"assert(typeof foods === 'object', '<code>foods</code>应该是一个对象。');"},{text:'<code>foods</code>应该有一个值为<code>13</code>的<code>"bananas"</code>属性。',testString:"assert(foods.bananas === 13, '<code>foods</code>应该有一个值为<code>13</code>的<code>\"bananas\"</code>属性。');"},{text:'<code>foods</code>应该有一个值为<code>35</code>的<code>"grapes"</code>属性。',testString:"assert(foods.grapes === 35, '<code>foods</code>应该有一个值为<code>35</code>的<code>\"grapes\"</code>属性。');"},{text:'<code>foods</code>应该有一个值为<code>27</code>的<code>"strawberries"</code>属性。',testString:"assert(foods.strawberries === 27, '<code>foods</code>应该有一个值为<code>27</code>的<code>\"strawberries\"</code>属性。');"},{text:"你应该用点符号或者方括号符号来设置对象的属性。",testString:"assert(code.search(/bananas:/) === -1 && code.search(/grapes:/) === -1 && code.search(/strawberries:/) === -1, '你应该用点符号或者方括号符号来设置对象的属性。');"}]},required:[],files:{indexhtml:null,indexjs:{key:"indexjs",ext:"js",name:"index",contents:"let foods = {\n  apples: 25,\n  oranges: 32,\n  plums: 28\n};\n\n// 请把你的代码写在这条注释以下\n\n// 请把你的代码写在这条注释以上\n\nconsole.log(foods);",head:"",tail:""},indexjsx:null}}},pathContext:{challengeMeta:{introPath:"",template:null,required:[],nextChallengePath:"/javascript-algorithms-and-data-structures/basic-data-structures/modify-an-object-nested-within-an-object",id:"587d7b7c367417b2b2512b18"},slug:"/javascript-algorithms-and-data-structures/basic-data-structures/add-key-value-pairs-to-javascript-objects"}}}});
